import React, { useEffect, useState } from "react";
import ReactDOM from 'react-dom/client';
import Image from "../Models/Image";

function ImageSlider(props){
    let [images,setImages]=useState(props.images);
    let [counter,setCounter]=useState(0);

    let deleteImage = async (imageId) => {
        let imagesCopy;
        for(let i=0;i<images.length;i++){
          if(images[i].id===imageId&&images[i].id!==-1){
            let newImages = images.filter(image => images[counter].id !== imageId);
            setImages(newImages);
            break;
    
          }
           else if(images[i].id===imageId&&images[i].id===-1){
              const newArray = [...images];
              newArray.pop();
              setImages(newArray);
          }
        }
        props.save(images);
    
      };
    
      let saveImage = (image,isNew) => {
          if(isNew){
            setImages([...images, image]);
          }
          else{
            setImages(images.map((existingImage) => (existingImage.id === image.id ? image : existingImage)));
          }
          props.save(images);
      };
      let step=(value)=>{
          let length=images.Length;
          let target=counter+value;
          if(target>=0&&target<length){
            setCounter(counter+value);
          }
        }
return(<div>
{images.length>0 && 
<div> 
  <div>
    <Image
                key={images[counter].id}
                name={images[counter].name}
                className="image-container float-right mt-5 ml-2 border border-dark"
                description={images[counter].description}
                image={images[counter].image}
                id={images[counter].id}
                edit={props.edit}
                delete={() => deleteImage(images[counter].id)}
                adder={false}
                createNew={(e)=>{saveImage(e,false)}}
             
              />
    </div>
    <div>
        {counter-2>=0 &&  <Image
                key={images[counter-2].id}
                name={images[counter-2].name}
                className="image-container float-right mt-5 ml-2 border border-dark"
                description={images[counter-2].description}
                image={images[counter-2].image}
                id={images[counter-2].id}
                edit={props.edit}
                delete={() => deleteImage(images[counter-2].id)}
                adder={false}
                createNew={(e)=>{saveImage(e,false)}}
                move={()=>{step(-2)}}  
                slide={true}
              />}
        {counter-1>=0 &&  <Image
                key={images[counter-1].id}
                name={images[counter-1].name}
                className="image-container float-right mt-5 ml-2 border border-dark"
                description={images[counter-1].description}
                image={images[counter-1].image}
                id={images[counter-1].id}
                edit={props.edit}
                delete={() => deleteImage(images[counter-1].id)}
                adder={false}
                createNew={(e)=>{saveImage(e,false)}}
                move={()=>{step(-1)}}  
                slide={true}
              />}
        {counter+1<images.Length &&  <Image
                key={images[counter+1].id}
                name={images[counter+1].name}
                className="image-container float-right mt-5 ml-2 border border-dark"
                description={images[counter+1].description}
                image={images[counter+1].image}
                id={images[counter+1].id}
                edit={props.edit}
                delete={() => deleteImage(images[counter+1].id)}
                adder={false}
                createNew={(e)=>{saveImage(e,false)}}
                move={()=>{step(1)}}  
                slide={true}
              />}
        {counter+2<images.Length &&  <Image
                key={images[counter+2].id}
                name={images[counter+2].name}
                className="image-container float-right mt-5 ml-2 border border-dark"
                description={images[counter+2].description}
                image={images[counter+2].image}
                id={images[counter+2].id}
                edit={props.edit}
                delete={() => deleteImage(images[counter+2].id)}
                adder={false}
                createNew={(e)=>{saveImage(e,false)}}
                move={()=>{step(2)}}
                slide={true}
              />}
              <button  type="button" onClick={()=>{step(-1)}}>Previous</button>
              <button  type="button" onClick={()=>{step(1)}}>Next</button>
              </div>
              </div>}
   
              {props.edit===true&&<Image
                key={images[counter+2].id}
                name={images[counter+2].name}
                className="image-container float-right mt-5 ml-2 border border-dark"
                description={images[counter+2].description}
                image={images[counter+2].image}
                id={images[counter+2].id}
                edit={props.edit}
                delete={() => deleteImage(images[counter+2].id)}
                adder={true}
                createNew={(e)=>{saveImage(e,true)}}
             
              />}
</div>);
      
}
export default ImageSlider;
